import React , { Component } from "react";
import Helmet from "react-helmet";
import { WEBSITE_NAME } from "../../../utils/websiteData";
import 'blog.css' 

import Offer from './Offer';



class Offers extends Component {

state = {
  posts: [
    { id: 'asfa1', title: 'Social aides' , desc:'some valu'},
    { id: 'vasdf1', title: 'Medical services' , desc:'description'},
    { id: 'vasdd2', title: 'Solidarity services' , desc:''},
    { id: 'asdf11', title: 'Others services' , desc:''}
  ],
  sub : [
    { id: 'asfa2', title: 'file' , desc:''},
    { id: 'vasdf3', title: 'topic' , desc:''},
    { id: 'vasdd4', title: 'os' , desc:''},
    { id: 'asdf15', title: 'yes' , desc:''}
  ],
  showOffers: false
}

render(){

  return(
      <div>
        <Helmet>
        <title>{`${WEBSITE_NAME} | Offers`}</title>
        </Helmet>
        <input className='input-text' 
               placeholder='search ...'
               type='text'
               name='search'
               required />
        <div className='boxs'>
        <section className="Posts">
            <Offer title={this.state.posts[0].title} desc={this.state.posts[0].desc}></Offer>
            <Offer title={this.state.posts[1].title} desc={this.state.posts[1].desc}></Offer>
            <Offer title={this.state.posts[2].title} desc={this.state.posts[2].desc}></Offer>
            <Offer title={this.state.posts[3].title} desc={this.state.posts[3].desc}></Offer>
            </section>
            
        </div>
        

      </div>
  )
}}

export default Offers ;
